import './Home.css';
import React from "react";
import { useCookies } from "react-cookie";
import { useNavigate } from "react-router-dom";
//Home Page
function Home() {
    const [cookies, setCookies] = useCookies(["access_token"]);
    const naviagte = useNavigate();
    const logout = () => {
        setCookies("access_token", "");
        window.localStorage.removeItem("userID");
        naviagte("/login");
    }


    return (
        <div>
            <h1>Courts</h1>
            

            <div class="navbar">
                {!cookies.access_token ?  <a href="http://localhost:3000/register">Register</a> : <div><button class="logout-button" onClick={logout}>Logout</button> <button>Edit Preferences</button>
                </div>}
                <a href="http://localhost:3000/aboutus">About Us</a>
            </div>

        </div>
    );
}

export default Home;
